import React, { Component } from "react";
class InputBox extends Component {
  render() {
    return (
      <div id="I-outer">
        Input Image
        <div>
          Upload Image
          <button class="btn btn-primary" />
        </div>
      </div>
    );
  }
}
export default InputBox;
